const Experiences = () => {
  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="Skill 1"
              variant="outlined"
              value={values.s1}
              onChange={(event) => onValueChange("s1", event)}
              error={errors.s1}
              helperText={errors.s1 && errorMessages.s1}
              required
            />
            <TextField
              label="Skill 2"
              variant="outlined"
              value={values.s2}
              onChange={(event) => onValueChange("s2", event)}
              error={errors.s2}
              helperText={errors.s2 && errorMessages.s2}
              required
            />
            <TextField
              label="Skill 3"
              variant="outlined"
              value={values.s3}
              onChange={(event) => onValueChange("s3", event)}
              error={errors.s3}
              helperText={errors.s3 && errorMessages.s3}
              required
            />
            <TextField
              label="Skill 4"
              variant="outlined"
              value={values.s4}
              onChange={(event) => onValueChange("s4", event)}
              error={errors.s4}
              helperText={errors.s4 && errorMessages.s4}
              required
            />
          </form>
        </CardContent>
      </Card>
    </div>
  );
};

export default Experiences;
